-- ----------------------------
-- View structure for location_view
-- ----------------------------
DROP VIEW IF EXISTS `location_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`admin`@`localhost` SQL SECURITY DEFINER VIEW `location_view` AS select `location_view2`.`id` AS `id`,`location_view2`.`city_name` AS `city_name`,`location_view2`.`city_id` AS `city_id`,`location_view2`.`district_name` AS `district_name`,`location_view2`.`district_id` AS `district_id`,`location_view2`.`province_name` AS `province_name`,`location_view2`.`province_id` AS `province_id` from `location_view2` union select `location_view3`.`id` AS `id`,`location_view3`.`city_name` AS `city_name`,`location_view3`.`city_id` AS `city_id`,`location_view3`.`district_name` AS `district_name`,`location_view3`.`district_id` AS `district_id`,`location_view3`.`province_name` AS `province_name`,`location_view3`.`province_id` AS `province_id` from `location_view3` ;

-- ----------------------------
-- View structure for location_view2
-- ----------------------------
DROP VIEW IF EXISTS `location_view2`;
CREATE ALGORITHM=UNDEFINED DEFINER=`admin`@`localhost` SQL SECURITY DEFINER VIEW `location_view2` AS (select distinct `l2`.`id` AS `id`,_utf8'unknown' AS `city_name`,_utf8'unknown' AS `city_id`,`l2`.`location_name` AS `district_name`,`l2`.`id` AS `district_id`,`l1`.`location_name` AS `province_name`,`l1`.`id` AS `province_id` from (`location` `l2` left join `location` `l1` on(((`l2`.`parent_id` = `l1`.`id`) and (`l1`.`tier` = 1)))) where (`l2`.`tier` = 2)) ;

-- ----------------------------
-- View structure for location_view3
-- ----------------------------
DROP VIEW IF EXISTS `location_view3`;
CREATE ALGORITHM=UNDEFINED DEFINER=`admin`@`localhost` SQL SECURITY DEFINER VIEW `location_view3` AS (select distinct `l3`.`id` AS `id`,`l3`.`location_name` AS `city_name`,`l3`.`id` AS `city_id`,`l2`.`location_name` AS `district_name`,`l2`.`id` AS `district_id`,`l1`.`location_name` AS `province_name`,`l1`.`id` AS `province_id` from ((`location` `l3` left join `location` `l2` on(((`l3`.`parent_id` = `l2`.`id`) and (`l2`.`tier` = 2)))) left join `location` `l1` on(((`l2`.`parent_id` = `l1`.`id`) and (`l1`.`tier` = 1)))) where (`l3`.`tier` = 3)) ;

-- ----------------------------
-- View structure for participants_view
-- ----------------------------
